import React, { Component } from 'react';
import './App.css';
import Home from './pages/Home';
import { Route } from "react-router-dom";
import Contact from "./components/Contact";

function App() {
    return ( <
        div className = "App" >
        <
        Route exact path = "/"
        component = { Home }
        />  <
        Contact / >
        <
        /div>
    );
}

export default App;
